(29, 1, 2, 'http://www.bdzy.cc/detail/?15802.html', '童话镇第二季', 'array (\n  \\''title\\'' => \\''童话镇第二季\\'',\n  \\''cname\\'' => \\''欧美剧\\'',\n  \\''intro\\'' => \\''18集\\'',\n  \\''time\\'' => \\''2013-3-25 13:59:40\\'',\n  \\''actor\\'' => \\''詹妮弗·莫里森 金妮弗·古德温 乔舒华·达拉斯\\'',\n  \\''content\\'' => \\''<p>该剧的故事情节由《迷失》制片人Adam Horowitz和Edward Kitsis构思，描述了一个发生在现代社会里的「黑色童话故事」。 童话故事总是以「很久很久以前」开始，而以「他们从此幸福地生活在一起」结尾－－至少字面上是这样。<br />&nbsp; 28岁的Emma Swan自小是个孤儿，从来都是自己照顾自己，但当10年前她放弃的儿子再次找到她的时候，一切都将改变。Henry10岁了，急需Emma的帮助，他认为Emma来自另一个世界，是白雪公主与白马王子丢失的女儿。根据他的童话书，他们把Emma送走是为了保护她不受邪恶女王咒语的伤害，她的咒语尘封了童话世界，冻结了时间。Emma当然不会相信Henry所说的，但当她把Henry送回Storybrooke之后，她就再难逃脱这一切了。Storybrooke远非看上去那么简单，魔法在这里已被遗忘，但却是童话中人物生活的地方，即使他们已经想不起来自己曾经是谁。不同世界之间的战争即将打响，Emma也将接受命运拼命战斗女星金妮弗&middot;古德温将在剧中饰演白雪公主以及她的姐姐Mary Margaret。这个角色被形容为：极为美丽的女性，黑发，雪白的皮肤，被邪恶的女王(拉娜&middot;帕瑞拉饰演)下了咒语，被一名白马王子在命悬一线时救了回来。</p>\\'',\n  \\''picurl\\'' => \\''http://pic4.8888fy.com/pic/uploadimg/2013-1/15802.jpg\\'',\n  \\''area\\'' => \\''欧美\\'',\n  \\''language\\'' => \\''英语\\'',\n  \\''year\\'' => \\''2012\\'',\n  \\''serial\\'' => \\''连载第18集\\'',\n  \\''playurl\\'' => \n  array (\n    0 => \\''\\'',\n    1 => \\''bdhd://180456381|44E9C74847ED8DE648CA548A8F4379BC|童话镇第二季01中英双字.rmvb\\'',\n    2 => \\''bdhd://183200824|442B2C2DD591AEA0AE018C260A56D9F6|童话镇第二季02中英双字.rmvb\\'',\n    3 => \\''bdhd://149748882|4F42C434C4A3BEB8ADB24380879D02A8|童话镇第二季03中英双字.rmvb\\'',\n    4 => \\''bdhd://152553738|9EBECA3019D51C0EA222863A5A3CC6C9|童话镇第二季04中英双字.rmvb\\'',\n    5 => \\''bdhd://159594210|A604DA020D97DCAA2B9159F5DFF356EF|童话镇第二季05中英双字.rmvb\\'',\n    6 => \\''bdhd://156779603|22DD0D0EC2359F9434066624CAAF00A7|童话镇第二季06中英双字.rmvb\\'',\n    7 => \\''bdhd://150943161|5689639C0E196C975E48CB844209AA67|童话镇第二季07中英双字.rmvb\\'',\n    8 => \\''bdhd://171752537|134D3FEC14A971CB158F3A8A5B5A0759|童话镇第二季08中英双字.rmvb\\'',\n    9 => \\''bdhd://152085697|0CDD2311D68DBCDB79A6173B7F342A03|童话镇第二季09中英双字.rmvb\\'',\n    10 => \\''bdhd://147859799|6A037E3E16F30EFAB6C120CD64930CC5|童话镇第二季10中英双